import React from "react";
import Axios from "axios";

class StudentViewRegisteredEvents extends React.Component {
  constructor(props) {
    super(props);
    this.startfunc = this.startfunc.bind(this);
  }

  startfunc() {
    //event.preventDefault();
    let email = localStorage.getItem("email");
    Axios.post("http://127.0.0.1:4001/studentviewregevent", { email: email })
      .then(data => {
        const student = data.data[0];
        var objectlength = Object.keys(student).length;

        for (var i = 0; i < objectlength; i++) {
          if (Object.values(student)[i] === "Yes") {
            var EVENTid = Object.keys(student)[i];
            var eventid = EVENTid.replace(/\D/g, "");
            console.log(eventid);
            Axios.post("http://127.0.0.1:4001/studentviewregeventUSINGID", {
              eventid: eventid
            })
              .then(data => {})
              .catch(err => {});
          }
        }
      })
      .catch(err => {
        console.log(err);
      });
  }

  componentDidMount() {
    this.startfunc();
  }

  render() {
    return <div>Reg Events</div>;
  }
}

export default StudentViewRegisteredEvents;
